import styled from 'styled-components';

export const Nav = styled.nav`
    background: #000;
    height: 78.7px;
    padding: 13px 0 5.7px 0;
    object-fit: contain;
    justify-content: center;
    align-items: center;
    position: sticky;
    top: 0;
    z-index: 10;


`

export const NavbarContainer = styled.div`
    display: flex;
    width: 100%;
    padding-left: 12.3%;
    padding-right: 13.4%;
    max-width: 1200px;
`

export const Logo = styled.img`
    height: 60px;
    margin: 0 2% 0 0;
    object-fit: contain;

`
export const Menu = styled.div`
    display : flex;
    width: 643
`


export const LeftMenu = styled.div`
    display : flex;
    width: 643.25px;
`

export const HomeLink = styled.a`
    width: 18px;
    height: 22px;
    color: #fff;
    margin: 16px 2.6% 22px 0;
    object-fit: contain;

`

export const DotVideoLink = styled.a`
font-color: #565656;
width: 72px;
height: 22px;
margin: 16px 25px 22px;
color: #fff;
margin: 16px 2.6% 22px 0;
object-fit: contain;
`

export const FollowLink = styled.a`
width: 54px;
height: 22px;
margin: 16px 45.3% 22px 25px;
color: #fff;
object-fit: contain;
`
export const RightMenu = styled.div`
    display : flex;

`

export const SearchLink = styled.a`
    width: 30px;
  height: 30px;
  color: #fff;
  margin: 12px 12.55px 18px 472px;
  object-fit: contain;
`
